// DeleteUniqueIndexCache 删除索引存在的缓存
func (h *HelpFaqRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.HelpFaq) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, h.cache.Key(CacheHelpFaqByConditionPrefix))
	keys = append(keys, h.cache.Key(CacheHelpFaqUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[h.cache.Key(CacheHelpFaqByIDPrefix, item.ID)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFaqUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFaqByCategoryIDPrefix, item.CategoryID)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFaqUnscopedByCategoryIDPrefix, item.CategoryID)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFaqByIsHotPrefix, item.IsHot)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFaqUnscopedByIsHotPrefix, item.IsHot)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFaqByStatusPrefix, item.Status)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFaqUnscopedByStatusPrefix, item.Status)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := h.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
